html, body{background-color:#171717 !important;
   background:url(data:image/gif;base64,) repeat-x fixed !important;

}
div.navbar{
   background-image:url(data:image/gif;base64,) !important;
   background-repeat:repeat !important;
   background-position:-15px top;
}
div.headerbar{
   height:82px !important;
   background-image:url(data:image/png;base64,) !important;
   background-repeat:repeat !important;
}
div#site-description {
   width:210px !important;
   margin:0 auto!important;   
   float:none !important;
}
div#site-description > a#logo{
   padding:0 !important;
   margin:4px 0 0 0 !important;
   background:transparent url(data:image/png;base64,) no-repeat left top !important;
   height:66px !important;
   width:210px !important;
   display:block !important;
}
div#site-description > a#logo:hover{
   background-position:left bottom !important;
}
div#site-description > a#logo > img{
   margin:0 auto !important;
   display:none !important;
}
html > body > center > iframe,
#wrap > center > iframe,
#wrap > center > table,
div.content dl.faq{
   display:none !important;
}
div.bottom-left, div.bottom-center, div.bottom-right{
   position:relative !important;
   top:18px !important;
}
div.bottom-left{
   margin-left:-6px !important;
}
div.bottom-center{
   margin-left:14px !important;
   margin-right:14px !important;
}
div.bottom-right{
   margin-right:-3px !important;
}
div.outside{
   width:100% !important;
   min-width:720px !important;
   max-width:890px !important;
}
div.inside{
   padding-top:0px !important;
   background-image:none !important;
   background-color:#FFF !important;
}
div#wrap{
   width:inherit !important;
   padding:0 15px !important;
}
div.forabg{
   margin:2px 0 !important;
}
dl.attachbox{
   width:99% !important;
}
div.navbar{
   background-color:#E1CFB1 !important;
}
ul.topiclist li.header dl.icon{
   background-image:url(data:image/png;base64,) !important;
   background-repeat:repeat !important;
}
li.row:hover{
   background-image:url(data:image/gif;base64,) !important;
   background-position:-16px top !important;
}
